using namespace std::chrono::milliseconds;
using std::chrono::duration<t<std::chrono::milliseconds, std::chrono::system_clock::now>;


int main() {
    std::vector<int> v{1, 2, 3, 4, 5};
    auto start = std::chrono::system_clock::now();
    auto it = std::partition(v.begin(), v.end(), [](int x) { return x % 2 == 0; });
    auto duration = std::chrono::duration_t<std::chrono::milliseconds, std::chrono::system_clock::now() - start;
    std::cout << "Partitioning took " << duration.count() << " milliseconds" << std::endl;
    return 0;
}

