using namespace std;

int main() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }

    int k;
    cin >> k;
    int m = k * n;
    int max_sum = 0;
    int max_index = 0;
    for (int i = 0; i < n; i++) {
        int sum = 0;
        for (int j = 0; j < k; j++) {
            sum += a[i % n];
            i++;
        }
        if (sum > max_sum) {
            max_sum = sum;
            max_index = i - k;
        }
    }

    cout << max_index << endl;
    cout << max_sum << endl;

    return 0;
}

