using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        int n = s.length();
        vector<int> dp(n, 0);
        dp[0] = 1;
        int res = 1;

        for (int i = 1; i < n; ++i) {
            for (int j = i - 1; j >= 0; --j) {
                if (s[i] == s[j]) {
                    dp[i] = max(dp[i], dp[j] + 1);
                } else {
                    dp[i] = max(dp[i], dp[j] + 1);
                }
            }
            res = max(res, dp[i]);
        }

        return res;
    }
};

int main() {
    Solution solu;
    string s = "abcabcbb";
    int res = solu.lengthOfLongestSubstring(s);
    cout << res << endl;
    return 0

