    TEST_CLASS(LexerTest)
    {
    public:
        TEST_METHOD(Lexer_EmptyString_ReturnsEmptyTokenList)
        {
            std::string input;
            TokenList tokens = Lexer::Lex(input);
            Assert::AreEqual(0, tokens.size());
        }

        TEST_METHOD(Lexer_SingleCharacter_ReturnsSingleToken)
        {
            std::string input = "a";
            TokenList tokens = Lexer::Lex(input);
            Assert::AreEqual(1, tokens.size());
            Assert::AreEqual(Token::Type::Identifier, tokens[0].type);
            Assert::AreEqual("a", tokens[0].value);
        }

