int main() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }

    int k;
    cin >> k;

    int sum = accumulate(a.begin(), a.end(), 0);
    int target = sum * k / 100;

    int l = lower_bound(a.begin(), a.end(), target) - a.begin();
    int r = upper_bound(a.begin(), a.end(), target) - a.begin();

    int ans = 0;
    if (l < r) {
        ans = r - l;
    }

    cout << ans << endl;

    return 0;
}

