using namespace std;

class Solution {
public:
    int findKthLargest(vector<int>& nums, int k) {
        int n = nums.size();
        if (n == 0) return 0;
        if (n == 1) return nums[0];
        sort(nums.begin(), nums.end());
        return nums[n - k];
    }
};

int main() {
    Solution s;
    vector<int nums = {1, 5, 3, 6, 7, 2, 4};
    int k = 2;
    cout << s.findKthLargest(nums, k) << endl;
    return 0;
}

