package com.github.kornilov-s.matlab.parser.model;

import com.github.kornilov-s.matlab.parser.model.enums.MatlabTokenType;

import java.util.List;

public class MatlabToken {

    private final MatlabTokenType type;
    private final String value;
    private final int line;
    private final int column;

    public MatlabToken(MatlabTokenType type, String value, int line, int column) {
        this.type = type;
        this.value = value;
        this.line = line;
        this.column = column;
    }

    public MatlabTokenType getType() {
        return type;
    }

    public String getValue() {
        return value;
    }

    public int getLine() {
        return line;
    }

    public int getColumn() {
        return column;
    }

    @Override
    public String toString() {
        return "MatlabToken{" +
                "type=" + type +
                ", value='" + value + '\'' +
                ", line=" + line +
                ", column=" + column +
                '}';
    }
}

