using namespace std;

int main() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; i++) {
        cin >> a[i];
    }

    sort(a.begin(), a.end());
    int m = a.size();
    int k = 0;
    for (int i = 0; i < m; i++) {
        if (a[i] % 2 == 0) {
            k++;
        }
    }

    int ans = 0;
    for (int i = 0; i < m; i++) {
        if (a[i] % 2 == 0) {
            ans += i;
        }
    }

    cout << k << " " << ans << endl;
    return 0;
}

