int main() {
    int n;
    cin >> n;
    vector<int> arr(n);
    for (int i = 0; i < n; i++) {
        cin >> arr[i];
    }
    sort(arr.begin(), arr.end());
    int k;
    cin >> k;
    int sum = 0;
    for (int i = 0; i < n; i++) {
        if (i + k - 1 < n) {
            sum += arr[i] * (n - i - 1);
        }
    }
    cout << sum << endl;
    return 0;
}

